import React from 'react';
import './App.css';
import tag from './assets/img/tag.svg';

function App() {
  return (
    <div className="App">
      <img src={tag} alt='tag' /> 
      <h1>Rafael <span>dev</span></h1>
      <p><span>HTML</span> - <span>CSS</span> - <span>JS</span> - <span>React</span> - <span>React Native</span> - <span>Redux</span> - <span>NodeJs</span></p>
    </div>
  );
}

export default App;
